webpackJsonp([0xd9a94b9df321],{3984:function(n,p){n.exports={data:{markdownRemark:{html:"<p>2004/12/29のdanmaq結成からいつのまに1年経過してたみたいで。いや時の流れるのは早いものだ'Ａ｀ と言うことで2005/2/1から2006/1/31までの365日間を対象にアクセス解析レポートを出してみました。(実際には1/20頃解析導入したが中途半端に尻切れになるので月始めまで除外)</p>\n<h2>総合データ</h2>\n<ul>\n<li>\n<p>解析期間：2005/2/1～2006/1/31(365日間)</p>\n</li>\n<li>\n<p>総アクセス数：254,298</p>\n<h2>月間アクセス数</h2>\n</li>\n<li>\n<p>最多：2005/8(44,235)</p>\n</li>\n<li>\n<p>最少：2005/3(9,965)</p>\n<h2>日別アクセス数</h2>\n</li>\n<li>\n<p>最多：2005/5/14(6,258)</p>\n</li>\n<li>\n<p>最少：2005/7/20(160)</p>\n</li>\n<li>\n<p>平均：697</p>\n<h2>曜日別アクセス数</h2>\n</li>\n<li>\n<p>最多：日(42,116)</p>\n</li>\n<li>\n<p>最少：木(32,217)</p>\n<h2>時間別アクセス数</h2>\n</li>\n<li>\n<p>最多：23時(19,354)</p>\n</li>\n<li>\n<p>最少：6時(3,714)</p>\n<h2>使用ブラウザのTOP5</h2>\n</li>\n<li>\n<p>IE(209,951)</p>\n</li>\n<li>\n<p>Firefox(13,116)</p>\n</li>\n<li>\n<p>Lunascape(3,575)</p>\n</li>\n<li>\n<p>Netscape(3,096)</p>\n</li>\n<li>\n<p>Opera(2,854)</p>\n<h2>使用OSのTOP5</h2>\n</li>\n<li>\n<p>WindowsXP(185,306)</p>\n</li>\n<li>\n<p>Windows2000(30,626)</p>\n</li>\n<li>\n<p>WindowsMe(10,085)</p>\n</li>\n<li>\n<p>Windows98(7,873)</p>\n</li>\n<li>\n<p>MacOS X(7,366)</p>\n<h2>ドメインTOP5</h2>\n</li>\n<li>\n<p>jp(200,047)</p>\n</li>\n<li>\n<p>net(36,060)</p>\n</li>\n<li>\n<p>com(6,241)</p>\n</li>\n<li>\n<p>tw(1,238)</p>\n</li>\n<li>\n<p>de(185)</p>\n<h2>検索ワードTOP5</h2>\n</li>\n<li>\n<p>東方時封城(7,464)</p>\n</li>\n<li>\n<p>danmaq(932)</p>\n</li>\n<li>\n<p>幻想音楽祭(151)</p>\n</li>\n<li>\n<p>東方弾幕風(139)</p>\n</li>\n<li>\n<p>夜がずり落ちてくる(64)</p>\n<h2>言語域TOP5</h2>\n</li>\n<li>\n<p>日本語(15,712)</p>\n</li>\n<li>\n<p>英語/米(1,966)</p>\n</li>\n<li>\n<p>中国語/台(321)</p>\n</li>\n<li>\n<p>中国語/中(103)</p>\n</li>\n<li>\n<p>スウェーデン語/瑞(32)\n検索ワードがなかなか面白かったりするのですが、また長くなりそうなので次回の日記にでも。</p>\n<h2>以下駄文</h2>\n<p>ギリギリってやっぱだめだなぁと思った。預金ゼロだけど今の現場入って週6.5ペースで働いてる限り辛うじて黒出る程度の状況ゆえ、それほど困ってはいなかったが(強いて挙げるなら同人活動する時間が殆んどないって程度)やっぱそれは平常時の話であって緊急時には著しく不利だと思った。 と言うわけで送迎バス故障で来れない→タクシー代ない→自転車だと到着時には仕事終わっちゃう→あぼーんと、地元の勤務態度悪い高校生バイトもびっくりなトンデモ理由で今日はお休みorz</p>\n</li>\n</ul>",frontmatter:{cover:null,date:"2006-02-20T09:58:00+09:00",strDate:"2006/2/20",title:"danmaq一周年"}}},pathContext:{path:"/ja/blog/2006/02/20-danmaq一周年/",langKey:"ja"}}}});
